import Form from "./Form";
import GetTable from "./GetTable";
import NavBar from "../NavBar/nav";
function Interface() {
  return (
    <div>
      <div className="addUser">
        <Navbar />
        <div></div>
        <Form />
      </div>
      <GetTable />
    </div>
  );
}
export default Interface;
